import styled from "styled-components";

const Div = styled.div``;

const Index = () => {
  return (
    <div className="input-btns">
      <input type="radio" name="scheme" id="red" value="red" />
      red
      <input type="radio" name="scheme" id="black" value="black" />
      black
      <input type="radio" name="scheme" id="blue" value="blue" />
      blue
    </div>
  );
};

export default Index;
